import React, { Component } from 'react'
import axios from 'axios';
const url3="http://localhost:4000/bookingTickets";
export default class TicketBooking extends Component {
    constructor(props) {
        super(props);
        this.state = {
          form: {

            movieName: this.props.match.params.movieName,
            cost: this.props.match.params.cost,
            show:"",
            noOfTicket:"",
          },
          form: {
            movieId: this.props.match.params.movieId,
            movieName:"",
            show:"",
            noOfTicket:"",
            movieLink:"",
          },
          formErrorMessage: {
            movieId: "",
            movieName:"",
            cost:"",
            path:"",
            movieLink:"",
          },
          formValid: {
            movieId: false,
            movieName: false,
            cost:false,
            path:false,
            movieLink:false,
          },
          movieList: [],
          errorMessage: "",
          successMessage: "",
        };
      }
      submitBooking = (event) => {
        const newForm = {
            ...this.state.form,
          };
        axios
        .post(url3,newForm)
        .then((res)=>{
            this.setState({
              successMessage: "Ticket Booked successfully!!",
              errorMessage: "",
            });
            setTimeout(()=>this.props.history.push("/userview"), 2500); 
        })
        .catch((error) => {
          if (error.response == undefined) {
            this.setState({
              errorMessage: "Please start your JSON Server",
              successMessage: "",
            });
          } else if (error.response.status == 404) {
            this.setState({
              errorMessage: "Ticket Booking Failed!",
              successMessage: "",
            });
          }
        });
    };
    handleSubmit = (event) => {
        event.preventDefault();
        this.submitBooking();
        
      };
    
      handleChange = (event) => {
           const name = event.target.name;
            const value = event.target.value;
            const newState={
                form: {
                  ...this.state.form,
                  [name]: value,
                },
              };
              this.setState(newState);
              this.validateField(name, value)
      };
      validateField = (fieldName, value) => {
        const { formErrorMessage, formValid } = this.state;
            switch (fieldName) {
              
    
                case "movieName":
                if (value === "") {
                  formErrorMessage.movieName = "Please enter a Movie Name";
                  formValid.movieName = false;
                } else {
                  formErrorMessage.movieName = "";
                  formValid.movieName= true;
                }
                break;

                    case "noofTickets":
                    if (value === "") {
                      formErrorMessage.path = "Please Enter Tickets";
                      formValid.path = false;
                    }
                      else {
                      formErrorMessage.path = "";
                      formValid.path= true;
                    }
                    break;
              default:
                break;
            }
      };
  render() {
    return (
        <form className="container">
        <div className="CreateBooking">
          <div className="row">
            <div className="col-md-6 offset-md-3">
              <br />
              <div className="card">
                <div className="card-header bg-custom">
                  <h3>TICKET BOOKING</h3>
                </div>
                <div className="card-body">
                  { 
                    <div class="form-group">
                    
                    <label className="font-weight-bold">Movie ID:</label>
                    <input type="text" className="form-control" 
                    value={this.state.form.movieId}
                    name="movieId" placeholder="e.g.- M1001" disabled></input>
                   
                   <label className="font-weight-bold">Movie Name:</label>
                    <input type="text" className="form-control" 
                    value={this.state.form.movieName}
                    name="movieName" ></input>

                    <label className="font-weight-bold">Show Time:</label>
                    <select className="form-control" name="show">
                    <option value="a">10:00 AM</option>
                    <option value="b">12:45 PM</option>
                    <option value="c">3:30PM</option>
                    <option value="d">6:00PM</option>
                    <option value="e">10:00PM</option>
                    </select>
                   
                   <label className="font-weight-bold">No of Tickets:</label>
                    <input type="number" className="form-control" 
                    name="nooftickets"></input>

                     </div>  
                  }
                  
                </div>
              </div>
            </div>
          </div>
        </div>
        </form>
    )
  }
}
